      $16,105.09 in receipts because of issues with our reporting software.  Without
      making any changes to our receipts, our rerunning the report in preparation
      for our 1st amended October Monthly resulted in the receipts being populated,
      as they were when we ran the report prior to filing the original report.    In
      our effort to ensure compliance and assurance in our reporting we have since
      received technical support and updates to correct the problem.     2. The amounts
      reported on Schedule H4 Line 21(a) in activity identified as MEMO entries without
      any corresponding itemized transaction(s) are the result of reported MEMO transactions
      that occurred during the 09/01/08-09/30/08 reporting period but were not paid
      on a corresponding itemized transaction until after the 09/01/08-09/30/08 reporting
      period.  The itemized transaction(s) occurred in October 2008.'
